import React, { useState } from "react";
import { Navigate } from "react-router-dom";

function NewTicketForm() {
  const [formData, setFormData] = useState({
    sujet: "",
    departement: "",
    type: "",
    description: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Ticket créé :", formData);
    // Tu peux appeler une API ici si besoin
  };

  return (
    <form style={form} onSubmit={handleSubmit}>
      <div style={inputGroup}>
        <label htmlFor="sujet" style={label}>Sujet</label>
        <input
          type="text"
          id="sujet"
          name="sujet"
          value={formData.sujet}
          onChange={handleChange}
          placeholder="Ex : Virement non effectué"
          style={input}
          required
        />
      </div>

      <div style={inputGroup}>
        <label htmlFor="departement" style={label}>Département</label>
        <select
          id="departement"
          name="departement"
          value={formData.departement}
          onChange={handleChange}
          style={input}
          required
        >
          <option value="">-- Sélectionner --</option>
          <option value="IT">IT - Informatique</option>
          <option value="RH">RH - Ressources Humaines</option>
          <option value="Comptabilité">Comptabilité</option>
        </select>
      </div>

      <div style={inputGroup}>
        <label htmlFor="type" style={label}>Priorité</label>
        <select
          id="type"
          name="type"
          value={formData.type}
          onChange={handleChange}
          style={input}
          required
        >
          <option value="">-- Choisir --</option>
          <option value="Urgent">Urgent</option>
          <option value="Normal">Normal</option>
          <option value="Faible">Faible priorité</option>
        </select>
      </div>

      <div style={inputGroup}>
        <label htmlFor="description" style={label}>Description</label>
        <textarea
          id="description"
          name="description"
          rows="4"
          value={formData.description}
          onChange={handleChange}
          placeholder="Décrivez le problème rencontré..."
          style={textarea}
          required
        ></textarea>
      </div>

      <div style={buttonGroup}>
        <button type="submit" style={submitButton}>Soumettre</button>
      </div>
    </form>
  );
}

// ✅ Styles inline
const form = {
  display: "flex",
  flexDirection: "column",
  gap: "1.2rem",
};

const inputGroup = {
  display: "flex",
  flexDirection: "column",
};

const label = {
  fontWeight: "600",
  marginBottom: "0.5rem",
  color: "#003366",
};

const input = {
  padding: "0.8rem",
  fontSize: "1rem",
  borderRadius: "8px",
  border: "1px solid #ccc",
  backgroundColor: "#f9f9f9",
};

const textarea = {
  ...input,
  resize: "vertical",
  minHeight: "100px",
};

const buttonGroup = {
  marginTop: "1.5rem",
  display: "flex",
  justifyContent: "flex-end",
};

const submitButton = {
  backgroundColor: "#003366",
  color: "#fff",
  border: "none",
  padding: "0.8rem 1.6rem",
  fontSize: "1rem",
  borderRadius: "8px",
  cursor: "pointer",
  fontWeight: "600",
};

export default NewTicketForm;
